import styled from 'styled-components'
import {MdKeyboardArrowRight} from 'react-icons/md'

const dropDownMenuItem = ({titles}) => {
  return (
    <MenuItem>
      <MentItemTitle>{titles.title}<MdKeyboardArrowRight size={20}/></MentItemTitle>
      {titles.texts.map((v,i) =>
        i === 7 ? <MenuItemText key={i}>{v}<MdKeyboardArrowRight size={20}/></MenuItemText>
          : <MenuItemText key={i}>{v}</MenuItemText>
      )}
    </MenuItem>
  )
}

export default dropDownMenuItem;

const MenuItem = styled.div`
  display: flex;
  flex-direction: column;
  width: 16.666%;
  height: 270px;
  padding: 40px 20px 0 0;
  text-align: left;
`
const MentItemTitle = styled.div`
  position: relative;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  font-size: 17px;
  color: #333;
  line-height: 20px;
  vertical-align: top;
  padding-right: 20px;
  padding-bottom: 15px;
  width: 100%;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
`
const MenuItemText = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  position: relative;
  font-size: 13px;
  color: #999;
  padding: 5px 20px 5px 0;
  width: 100%;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
`
